import React from 'react';
import { Box, Grid, Typography } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
    container: {
        position: "absolute",
        top: "40%",
        left: "50%",
        transform: "translate(-50%, -50%)",
        width: "100vw",
        textAlign: "center",
        zIndex: 1
    }
  }));

const Resume = () => {
    return (
        <Box className="">
            <Grid container>
                <Grid item>
                    <h5>Resume</h5>
                </Grid>
            </Grid>
        </Box>
    )
}

export default Resume
